    - type: Paper
      content: >2-
         В космическом пространстве сейчас наступает новый 2568 год, а мы что-то забыли с командой по утилизации в открытом космосе, кто же знал, что блюспейс прыжок закинет нас в самые глубины космоса, чёртовы технологии Нанатрейзен! Мы сейчас находимся в самых глубинах этого проклятого космоса, иначего его не назоввёшь. Что же, у всего есть свои плюсы, хоть бы нас тут никто не будет тревожить. Но и мы никого. Хорошо, что связь есть и будет с кем пообщаться и не сойти с ума. Только с запасами выходит туго, в ящиках осталось всего два пайка, не думаю, что этого хватит на нас всех, пока мы будем проводить свой отдых в этой космической пустоши.
         Надеюсь нам как-то удастся вылететь из этого пространства на нашу станцию. Пораскинув мозгами, я посчитал, что на это у нас займёт всего 14 световых лет. Чтож, надежда умирает последний, как говорили умные люди, так что не повод расстраиваться. Наверное.
         Конец записи
